"196214":{"id":"196214","name":"Ou Tudo ou Nada de Novo","slug":"ou-tudo-ou-nada-de-novo","original_title":"The Full Monty","overview":"Gaz, Dave e o seu grupo estão de volta depois de 25 anos, trocando as suas fantasias de palco por sequestro canino, pombos de corrida e uma situação não muito convencional de refém. Gaz pode ser o mais velho, mas não é o mais esperto. E seu melhor amigo, Dave, se recusa a ser arrastado para mais uma de suas confusões. Mas, quando uma tragédia acontece, todo o grupo deve se juntar para um propósito em comum: honrar um velho amigo.","first_air_date":"2023-06-14","episode_run_time":0,"vote_average":7.647,"number_of_seasons":1,"number_of_episodes":8,"created_by":["Simon Beaufoy","Alice Nutter"],"production_companies":["Searchlight Television","Little Island Productions","The Walt Disney Company EMEA","Red Wave Films","FX Productions"],"genres":["Comédia","Drama"],"certification":"N/A","backdrop_path":"https://image.tmdb.org/t/p/original/nJKJU0GP0aNj95TCIGz9z28sDt3.jpg","poster_path":"https://image.tmdb.org/t/p/original/6i8k9rG3O13WXY1aQyDsUF166Nl.jpg","cast":["Robert Carlyle","Mark Addy","Lesley Sharp","Hugo Speer","Paul Barber"],"trailer":"N/A","seasons":{"1":{"name":"Temporada 1","poster_path":"https://image.tmdb.org/t/p/original/6i8k9rG3O13WXY1aQyDsUF166Nl.jpg","backdrop_path":"https://image.tmdb.org/t/p/original/6i8k9rG3O13WXY1aQyDsUF166Nl.jpg","air_date":"2023-06-14","episode_count":8,"overview":"N/A","vote_average":0,"episodes":{"1":{"name":"Progredindo","overview":"Irritada com o pai, Destiny falta à aula e leva junto seu melhor amigo, Cal. Numa atitude impulsiva, eles furtam um carro, mas a empolgação logo acaba quando encontram uma passageira indesejada no banco traseiro. As coisas pioram quando eles buscam a ajuda da adolescente e gênio da informática, Tabani, para apagar provas digitais. Quando Destiny pede ao pai, Gaz, que os ajude, o tiro sai pela culatra.","air_date":"2023-06-14","runtime":51,"still_path":"https://image.tmdb.org/t/p/original/dyIoLVPp5xfRbQe4hFDkgXGmC3f.jpg","vote_average":0},"2":{"name":"Economia da Cadeia de Suprimentos","overview":"Tanto o edifício da Academia Spires quanto o casamento de Jean e Dave estão desmoronando, e Dave decide fazer amizade com um garoto de 12 anos, Twiglet. As repercussões da amizade de Dave e Twiglet desenterram e evidenciam velhos problemas do relacionamento de Jean e Dave. Enquanto isso, Destiny também encontra problemas na pessoa de Brian, o novo namorado da mãe, e a única válvula de escape da garota, a música, vai ser tirada dela.","air_date":"2023-06-14","runtime":52,"still_path":"https://image.tmdb.org/t/p/original/fvFUP3ZQXd6kU4zMxA8z7sk3VVs.jpg","vote_average":0},"3":{"name":"La Vie En Rose","overview":"Quando Gaz descobre que o grafiteiro Ant está na ala psiquiátrica onde trabalha, ele se decepciona ao saber que os remédios que Ant recebe estão atenuando sua criatividade. Gaz bola um plano para ajudar Ant a recuperar seu talento e quebra todas as regras no processo. Quando a recuperação de Ant não corre como o previsto, Gaz se questiona por que sempre se mete em situações assim.","air_date":"2023-06-14","runtime":50,"still_path":"https://image.tmdb.org/t/p/original/dsY0zK6e6ggmYctm23GFu2o3efK.jpg","vote_average":0},"4":{"name":"De Volta pra Casa","overview":"Com o desejo de impressionar seu marido Dennis, Lomper se encontra metido em um plano lucrativo, que envolve procriar pombos, um investidor com uma espingarda, um bilionário coreano e uma viagem a Amsterdã. De volta ao Reino Unido, as coisas dão errado, os investidores começam a se preocupar e os agiotas põem pressão. Em pânico, Lomper sofre para omitir a verdade de Dennis e é forçado a pedir ajuda a seus amigos mais próximos, cruzando Sheffield em busca de uma solução.","air_date":"2023-06-14","runtime":50,"still_path":"https://image.tmdb.org/t/p/original/cH5lIGOd8ut4iYjJkpUpklTgbF1.jpg","vote_average":0},"5":{"name":"De Volta pra Casa de Novo","overview":"Darren teme tudo, especialmente os vizinhos refugiados. Quando eles são despejados, não é natural para Darren convidá-los para ficar em sua casa. Mas o senso de certo e errado dele é mais forte que seus temores e, assim, começa um improvável romance entre Darren e Silvan, uma moça curda que vive a vida intensamente. Mas quando a ex-esposa de Darren, Paula, reaparece em sua vida, ele tem que decidir se deixará que seus temores o governem, ou se mergulhará no amor.","air_date":"2023-06-14","runtime":54,"still_path":"https://image.tmdb.org/t/p/original/orJBFgeIoWVIBrzPqe5dl8iQHR9.jpg","vote_average":0},"6":{"name":"Bem-vindo ao Emprego dos seus Sonhos","overview":"Horse perde a cabeça e faz sua voz ser ouvida em uma central de empregos. Quando os ânimos se acalmam e Horse recua, um indivíduo nada inocente, o ex-soldado Miller, decide tomar as rédeas da situação. Ao ver seu amigo preso no local com um homem imprevisível e armado, o grupo de amigos chega para o resgate. Durante a situação, Yvonne, noiva do ausente Guy, descobre que ele não é tudo o que parece.","air_date":"2023-06-14","runtime":39,"still_path":"https://image.tmdb.org/t/p/original/v5s9KWaItncSXMumzlYh9H1BOdu.jpg","vote_average":0},"7":{"name":"Ninguém Fica Pra Trás","overview":"Fugindo de algumas decisões desastrosas, Jean se perde no bosque, à noite, com sua ex-melhor amiga, Hetty, e sua mãe, Margaret. Dave precisa de um amigo e convida Gaz para voltar à sua vida. Eles bolam um plano para achar Jean. Enquanto isso, Destiny está em sua própria fuga e coloca seus melhores amigos, Cal e Tabani, numa encrenca junto com ela.","air_date":"2023-06-14","runtime":44,"still_path":"https://image.tmdb.org/t/p/original/8cVVvoh1e69mUOZ4jtqgOgkLNdd.jpg","vote_average":0},"8":{"name":"Não é Questão de Despertar, é Questão de se Erguer","overview":"A turma se reúne, infringindo a lei para homenagear um amigo.","air_date":"2023-06-14","runtime":49,"still_path":"https://image.tmdb.org/t/p/original/kGJeaKCczSzzRwn5Uu9xan1AmB3.jpg","vote_average":0}}}}},
